import { useState, useEffect } from "react";

function MainFrame() {

    var iframe = document.getElementById("dummyframe");
    var y = (iframe.contentWindow || iframe.contentDocument);
    var pre_info = y.document.getElementsByTagName("pre")[0].innerHTML;
    var item_info = JSON.parse(pre_info.slice(1, -1));

    return(

        <div className="MainFrame">

            <iframe name="dummyframe" id="dummyframe"></iframe>

            <form action="/handle_data" method="post" target="dummyframe">
                <label>Hello there?</label>
                <input type="text" name="user_input" className="user_in"/>
                <input type="submit" name="user_sub" className="user_in"/>
            </form>

        </div>
    )


}

export default MainFrame
